import React, { Component } from  'react'
import './index.css'
export default class Item extends Component {
  render() {
    const {todos} = this.props
    console.log(todos);
    return (
      <li>
          <label>
            <input type="checkbox"/>
            <span>{
              todos.map((item)=>{
                item.do
              })  
            }</span>
          </label>
          <button className='btn btn-danger' style={{display:'none'}}>删除</button>
        </li>
    )
  }
}
